post_content = "<h3>Lifeline Crisis Support & Suicide Prevention</h3>		
			<h3>Description</h3>		
		<p>Lifeline is a national charity providing all Australians experiencing a personal crisis with access to 24 hour crisis support and suicide prevention services.</p><p>The organization is committed to empowering Australians to be suicide-safe through mental health support, connection, compassion and hope.</p><p>Their vision is for an Australia free of suicide.</p>		
			<h3>Eligibility</h3>		
		<p>Lifeline is a national charity providing all Australians experiencing a personal crisis with access to 24 hour crisis support and suicide prevention services.</p><p>The organization is committed to empowering Australians to be suicide-safe through mental health support, connection, compassion and hope.</p><p>Their vision is for an Australia free of suicide.</p>		
			<h3>How to apply</h3>		
		Call 13 11 14（24 HRS A DAY）or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://www.lifeline.org.au/get-help/\">HERE</a>.		
												<figure>
											<a href=\"https://www.suicidecallbackservice.org.au/\" target=\"_blank\" rel=\"noopener\">
							<img width=\"200\" height=\"200\" src=\"/wp-content/uploads/2021/08/life.png\" alt=\"\" loading=\"lazy\" />								</a>
											<figcaption></figcaption>
										</figure>
			<h4>Contact</h4>		
					<ul>
							<li>
										131114 (24 HRS A DAY）
									</li>
								<li>
										lifeline.org.au/
									</li>
								<li>
										media@lifeline.org.au
									</li>
						</ul>"
